<script>
export default {
    data: () => ({
        country: {},
    }),
    methods: {
        handleStateClick (e) {
            if (e.target.tagName === 'path') {
                if (e.target.dataset.id) {
                    this.getCountry(e.target.dataset.id);
                }
            }
        },
        getCountry(id) {
            axios.post('/api/countries/' + id, {
                key: '53V363XcSVOEsqRtHjxW'
            })
            .then(response => {
                this.country = response.data;
                setTimeout(function () {
                    document.querySelector('.show-country').click();
                }, 300);
            })
            .catch(error => {
                console.log(error);
            });
        },
    }
}
</script>
